--            FUNÇÃO DE ALTERAÇÃO DE LINHA             --
---------------------------------------------------------
CREATE OR REPLACE FUNCTION fc_alterarlinha7245(relatorio int, codseq int, descricao VARCHAR(250)) RETURNS VOID AS
$$
BEGIN

  UPDATE orcparamseq
    SET
    o69_descr = UPPER(descricao),
    o69_labelrel = descricao
      WHERE o69_codparamrel = relatorio
        AND o69_codseq = codseq;

END
$$
language plpgsql;


