-----------------------------------------------------------------------------------
--            FUNÇÃO DE INCLUSÃO DE NOVA LINHA COM BASE EM UMA EXISTENTE         --
-----------------------------------------------------------------------------------
CREATE OR REPLACE FUNCTION fc_inserirlinha7245(relatorio int, codseq int, ordem int, descricao VARCHAR(250)) RETURNS VOID AS
$$

DECLARE
    reg record;
    rec record;

BEGIN
  --INCREMENTA CHAVE
  ALTER TABLE orcparamseq disable trigger ALL;
    for reg in (
      SELECT *
        FROM orcparamseq
          WHERE o69_codparamrel = relatorio
            AND o69_codseq >= ordem ORDER BY o69_codseq desc

    )loop
        UPDATE orcparamseq
          SET o69_ordem = reg.o69_ordem+1,
          o69_codseq = reg.o69_codseq+1
            WHERE o69_codparamrel = reg.o69_codparamrel
              AND o69_codseq = reg.o69_codseq;

        UPDATE orcparamseqorcparamseqcoluna
          SET o116_codseq = reg.o69_codseq+1
            WHERE o116_codparamrel = relatorio
              AND o116_codseq = reg.o69_codseq;
    END loop;
  ALTER TABLE orcparamseq enable trigger ALL;

  -- INSERE COM BASE EM OUTRA LINHA
  INSERT INTO orcparamseq(o69_codparamrel,o69_codseq,o69_descr,o69_grupo,o69_grupoexclusao,o69_nivel,o69_libnivel,o69_librec,o69_libsubfunc,o69_libfunc,o69_verificaano,o69_labelrel,o69_manual,o69_totalizador,o69_ordem,o69_nivellinha,o69_observacao,o69_desdobrarlinha,o69_origem)
  VALUES(
    relatorio, --o69_codparamrel
    ordem, --o69_codseq
    UPPER(descricao), --o69_descr
    (SELECT o69_grupo from orcparamseq where o69_codparamrel = relatorio AND o69_codseq = codseq), --o69_grupo
    (SELECT o69_grupoexclusao from orcparamseq where o69_codparamrel = relatorio AND o69_codseq = codseq), --o69_grupoexclusao
    (SELECT o69_nivel from orcparamseq where o69_codparamrel = relatorio AND o69_codseq = codseq), --o69_nivel
    (SELECT o69_libnivel from orcparamseq where o69_codparamrel = relatorio AND o69_codseq = codseq),--o69_libnivel
    (SELECT o69_librec from orcparamseq where o69_codparamrel = relatorio AND o69_codseq = codseq),--o69_librec
    (SELECT o69_libsubfunc from orcparamseq where o69_codparamrel = relatorio AND o69_codseq = codseq),--o69_libsubfunc
    (SELECT o69_libfunc from orcparamseq where o69_codparamrel = relatorio AND o69_codseq = codseq),--o69_libfunc
    (SELECT o69_verificaano from orcparamseq where o69_codparamrel = relatorio AND o69_codseq = codseq),--o69_verificaano
    descricao,--o69_labelrel
    (SELECT o69_manual from orcparamseq where o69_codparamrel = relatorio AND o69_codseq = codseq),--o69_manual
    (SELECT o69_totalizador from orcparamseq where o69_codparamrel = relatorio AND o69_codseq = codseq),--o69_totalizador
    ordem, --o69_ordem
    (SELECT o69_nivellinha from orcparamseq where o69_codparamrel = relatorio AND o69_codseq = codseq), --o69_nivellinha
    (SELECT o69_observacao from orcparamseq where o69_codparamrel = relatorio AND o69_codseq = codseq),--o69_observacao
    (SELECT o69_desdobrarlinha from orcparamseq where o69_codparamrel = relatorio AND o69_codseq = codseq),--o69_desdobrarlinha
    (SELECT o69_origem from orcparamseq where o69_codparamrel = relatorio AND o69_codseq = codseq) --o69_origem
  );

  -- INSERE COLUNAS
  for rec in (
    SELECT *
      FROM orcparamseqorcparamseqcoluna
        INNER JOIN orcparamseq
          ON orcparamseq.o69_codparamrel = orcparamseqorcparamseqcoluna.o116_codparamrel
            AND orcparamseq.o69_codseq = orcparamseqorcparamseqcoluna.o116_codseq
              LEFT JOIN periodo
                ON periodo.o114_sequencial = orcparamseqorcparamseqcoluna.o116_periodo
                  INNER JOIN orcparamseqcoluna
                    ON orcparamseqcoluna.o115_sequencial = orcparamseqorcparamseqcoluna.o116_orcparamseqcoluna
                      INNER JOIN orcparamrel
                        ON orcparamrel.o42_codparrel = orcparamseq.o69_codparamrel
                          WHERE o116_codparamrel = relatorio
                            AND o116_codseq = codseq
                              ORDER BY o114_sigla,o116_ordem
  )loop

  INSERT
      INTO orcparamseqorcparamseqcoluna(o116_sequencial, o116_codseq, o116_codparamrel, o116_orcparamseqcoluna, o116_ordem, o116_periodo, o116_formula)
      VALUES(
        (SELECT MAX(o116_sequencial)+1 FROM orcparamseqorcparamseqcoluna),
        ordem,
        relatorio,
        rec.o116_orcparamseqcoluna,
        rec.o116_ordem,
        rec.o116_periodo,
        rec.o116_formula
      );

  END loop;

END
$$
language plpgsql;


