--------------------------------------------------------------------------------------------------
--        FUNÇÃO PARA EXCLUSÃO DE UMA LINHA E COLUNAS DESSA LINHA E DECREMENTO DAS CHAVES       --
--------------------------------------------------------------------------------------------------
CREATE OR REPLACE FUNCTION fc_excluirlinhaecolunas7245(relatorio int, codseq int) RETURNS VOID AS
$$

DECLARE
    reg record;

BEGIN
  ALTER TABLE orcparamseq disable trigger ALL;

  DELETE FROM orcparamseq
    WHERE o69_codparamrel = relatorio
    AND o69_codseq = codseq;

  DELETE FROM orcparamseqorcparamseqcoluna
    WHERE o116_codparamrel = relatorio
    AND o116_codseq = codseq;

-- Decremento de chaves

  for reg in (
    SELECT *
      FROM orcparamseq
      WHERE o69_codparamrel = relatorio
      AND o69_codseq > codseq ORDER BY o69_codseq ASC

  )loop
      UPDATE orcparamseq
          SET o69_ordem = reg.o69_ordem-1,
              o69_codseq = reg.o69_codseq-1
              WHERE o69_codparamrel = reg.o69_codparamrel
                AND o69_codseq = reg.o69_codseq;

      UPDATE orcparamseqorcparamseqcoluna
          SET o116_codseq = reg.o69_codseq-1
              WHERE o116_codparamrel = relatorio
                AND o116_codseq = reg.o69_codseq;
    END loop;


  ALTER TABLE orcparamseq enable trigger ALL;
END
$$
language plpgsql;


